import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and button
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.waitForSelector('.search-btn', { timeout: 5000 });

    // Enter XSS payload in search input
    const xssPayload = "<script>alert('XSS')</script>";
    await page.fill('#searchInput', xssPayload);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_entered.png'));

    // Click search button
    await page.click('.search-btn');
    await page.waitForTimeout(1000); // Wait for potential XSS execution

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Check if XSS payload appears in page content
    const pageContent = await page.content();
    const xssDetected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS via search input with payload: " + xssPayload,
      extractedData: {
        xssPayload: xssPayload,
        xssDetected: xssDetected,
        pageContentLength: pageContent.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS attempt via search input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
